    - '8.8.4.4#DIRECT'
    - '1.1.1.1#DIRECT'
    - '9.9.9.9#DIRECT'
    - '2001:4860:4860::8888'
    - '2001:4860:4860::8844'
    - '2606:4700:4700::1111'
    - '2620:fe::fe'
